// Timeline.js
import React from "react";

const Timeline = () => {
  return (
    <section className="section-primary" id="timelinesection">
      <div className="container">
        <div className="row">
          <div className="col-md-12 section-heading">
            <h2>Resume</h2>
            <p className="lead">Major Accomplishments</p>
            <hr className="white" />
          </div>
        </div>
        <div className="row">
          <div className="col-md-12">
            <div id="timeline">
              {[
                { title: "Education", details: "Arizona State University, Ira A. Fulton School of Engineering\nB.S, Computer Science (Software Engineering) Aug 2023 - May 2027\n- Recipient of Arizona Promise Grant Scholarship\n- New American University Scholar - Dean's Award List", icon: "fa fa-star" },
                { title: "HMMT", details: "Harvard-MIT Math Tournament\nInvited to compete at Harvard-MIT Math Tournament, it is one of the largest and most prestigious high school competitions in the world.", icon: "fa fa-plus" },
                { title: "MIT Science Bowl Invitational", details: "Massachusetts Institute of Technology Science Bowl Invitational\nInvited to compete at the MIT Science Bowl with 3 other teammates.", icon: "fa fa-flask" },
                { title: "Arizona State Championship", details: "Middle Back position for the Deer Valley Men’s Volleyball Team. Helped win the State Championship 3-0 Final Match.", icon: "fa fa-futbol-o" },
              ].map((item, index) => (
                <div className="timeline-item" key={index}>
                  <div className="timeline-icon">
                    <i className={item.icon}></i>
                  </div>
                  <div className={`timeline-content ${index % 2 === 0 ? "right" : "left"}`}>
                    <h2>{item.title}</h2>
                    <p>{item.details.split('\n').map((line, i) => <span key={i}>{line}<br /></span>)}</p>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Timeline;
